// SeasonalCalendarPage.jsx
import React, { useState } from 'react';
import { CalendarDays, List } from 'lucide-react';
import { format } from 'date-fns';

const events = [
  {
    name: "Baby Month",
    mindset: "child care",
    value: "baby gear, nursery, baby clothing",
    start: new Date('2025-08-25T11:30:00'),
    end: new Date('2025-09-25T23:30:00'),
  },
  {
    name: "Christmas",
    mindset: "Holiday Cheers",
    value: "gifts, decor, party supplies",
    start: new Date('2025-09-07T15:30:00'),
    end: new Date('2025-12-25T05:00:00'),
  },
  {
    name: "Health & Wellness",
    mindset: "fitness, health",
    value: "gym gear, vitamins, wellness",
    start: new Date('2025-12-26T12:30:00'),
    end: new Date('2026-02-01T00:30:00'),
  },
  {
    name: "Valentine's Day",
    mindset: "Gifting & Celebration",
    value: "candy, flowers, cards",
    start: new Date('2025-12-29T12:30:00'),
    end: new Date('2026-02-15T00:00:00'),
  },
];

export default function SeasonalCalendarPage() {
  const [view, setView] = useState('calendar');
  const [startDate, setStartDate] = useState('2025-07-14');
  const [endDate, setEndDate] = useState('2026-07-14');

  const filteredEvents = events.filter(
    (event) =>
      event.start >= new Date(startDate) && event.end <= new Date(endDate)
  );

  return (
    <div className="p-4">
      <h1 className="text-2xl font-semibold mb-2">SEASONAL CALENDAR</h1>
      <p className="text-sm mb-4">
        Target amplifies seasonal events to help the guest prepare for special moments. Refer to the calendar below and plan your assortment and inventory accordingly.
      </p>

      <div className="bg-gray-100 p-4 rounded mb-4">
        <h2 className="font-semibold">FILTERED COUNT: {filteredEvents.length}</h2>
        <div className="flex flex-wrap gap-4 mt-2">
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="border p-2 rounded"
          />
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            className="border p-2 rounded"
          />
        </div>
      </div>

      <div className="flex space-x-4 mb-4">
        <button
          onClick={() => setView('calendar')}
          className={`flex items-center gap-2 px-4 py-2 rounded ${view === 'calendar' ? 'bg-blue-600 text-white' : 'bg-white border'}`}
        >
          <CalendarDays size={16} /> Calendar View
        </button>
        <button
          onClick={() => setView('list')}
          className={`flex items-center gap-2 px-4 py-2 rounded ${view === 'list' ? 'bg-blue-600 text-white' : 'bg-white border'}`}
        >
          <List size={16} /> List View
        </button>
      </div>

      {view === 'calendar' ? (
        <div className="bg-white border rounded p-4">
          <p className="text-sm mb-2">Event dates are approximate and subject to change by Target.</p>
          <ul>
            {filteredEvents.map((event, i) => (
              <li key={i} className="mb-2">
                <div className="font-bold text-blue-600">{event.name}</div>
                <div className="text-sm text-gray-600">
                  {format(event.start, 'MMM d, yyyy')} â€“ {format(event.end, 'MMM d, yyyy')}
                </div>
              </li>
            ))}
          </ul>
        </div>
      ) : (
        <div className="bg-white border rounded p-4">
          <table className="w-full text-left text-sm">
            <thead>
              <tr className="border-b">
                <th className="p-2">Event Name</th>
                <th className="p-2">Mindset</th>
                <th className="p-2">Start Date</th>
                <th className="p-2">End Date</th>
                <th className="p-2">Suggested Assortment</th>
              </tr>
            </thead>
            <tbody>
              {filteredEvents.map((event, i) => (
                <tr key={i} className="border-b hover:bg-gray-50">
                  <td className="p-2 text-blue-600 font-medium">{event.name}</td>
                  <td className="p-2">{event.mindset}</td>
                  <td className="p-2">{format(event.start, 'MMM d, yyyy h:mm a')}</td>
                  <td className="p-2">{format(event.end, 'MMM d, yyyy h:mm a')}</td>
                  <td className="p-2">{event.value}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
